import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { RootState } from '../store/store'
import { OrderDelete } from '../store/menuSlice'
import { Food } from '../type'
import ItemOrder from './ItemOrder'

export default function ListOrder() {


  const products =useSelector((state: RootState) => state.stores.UserOrder)
  const dispatch = useDispatch()

  const deleteItem = (product:Food):void => {
    dispatch(OrderDelete(product))
  }

  return (

    <div>
               <button type="button"
                className="rounded-md bg-red-300 px-2.5 py-1.5 text-sm  text-gray-900 shadow-sm ring-1 ring-inset "
                      onClick={() => console.log('feefe')} >
                        X
              </button>

  <div className="bg-white">

  <div className="mx-auto max-w-2xl px-4 py-16 sm:px-6 sm:py-24 lg:max-w-7xl lg:px-8">
    <h2 className="text-2xl font-bold tracking-tight text-gray-900">Customers also purchased</h2>

    <div className="mt-6 grid grid-cols-1 gap-x-6 gap-y-10 sm:grid-cols-2 lg:grid-cols-4 xl:gap-x-8">
      {products.map((product) => (

        <ItemOrder product={product}/>

      ))}
    </div>
  </div>
</div>
</div>
  )
}
